export default function Register() {
    return(
        <div>
            <NavBar>
                    <div><NavLink to='/'>Home</NavLink></div>
            </NavBar>
            <div style={{margin: 'auto'}}><RegisterComponent></RegisterComponent></div>
            <div>register</div>
        </div>
    )
}
